import React, { Fragment } from 'react'

const SectionLeft = (props) => {
  return (
    <Fragment>
      {props.blablas.map(blabla => {
        return <Fragment><h2 className="title-bold">blabla.title</h2>
          <h3 className="featured-item-subheader italic">blabla.subtitle</h3>
        <p className="featured-item-body">blabla.text</p>
        </Fragment>
      })}
    </Fragment>
  )
}

export default SectionLeft;
